import Common from './Common';
export default class Logger extends Common {
    LOG: string;
    INFO: string;
    WARN: string;
    ERROR: string;
    PROFILE: string;
    log(...args: any): void;
    /**
     * The {@link logger.info} function is an alias for {@link logger.log()}.
     * @param args
     */
    info(...args: any): void;
    error(...args: any): void;
    warn(...args: any): void;
    profile(id: string, message?: string): string;
}
